// src/nodes/BaseNode.js
import React from 'react';
import { Handle, Position } from 'reactflow';

export default function BaseNode({ id, data }) {
  const {
    title = 'Node',
    subtitle,
    inputs = [], // [{id, label}]
    outputs = [], // [{id, label}]
    children,
  } = data || {};

  return (
    <div className="node-card">
      <div className="node-header">
        <div className="node-title">{title}</div>
        {subtitle ? <div className="badge">{subtitle}</div> : null}
      </div>
      <div className="node-body">
        {children}
      </div>

      {/* left handles */}
      {inputs.map((h, idx) => (
        <Handle
          key={`in-${h.id}`}
          id={h.id}
          type="target"
          position={Position.Left}
          style={{ top: 40 + idx * 24 }}
        />
      ))}

      {/* right handles */}
      {outputs.map((h, idx) => (
        <Handle
          key={`out-${h.id}`}
          id={h.id}
          type="source"
          position={Position.Right}
          style={{ top: 40 + idx * 24 }}
        />
      ))}
    </div>
  );
}
